Salween (1995)
Thai movie
Directed by: Chatrichalerm Yukol

Language: Thai
Subtitles: English

The border of Burma and Thailand is lawless place, where people live and die by the law of the gun. Into this situation comes a young police lieutenant, intent on reforming the rough and rowdy local police force along the Salween River. But the ongoing fight by the Karen tribe against the Burmese government spills over into the Thailand, making the lieutenant&amp;#039;s task a difficult one.
